import React from 'react'

const Notification = ( { message, errorMessage } ) => {
  if (message === null & errorMessage === null) {
    return null
  } else if (message === null) {
    return (
      <div className="error">
        {errorMessage}
      </div>
    )
  } else if (errorMessage === null) {
    return (
      <div className="added">
        {message}
      </div>
    )
  } 
}

export default Notification
